(3844, 105, 180, 11, 1, 2, 84, 1, NULL, NULL, '2023-09-06', '../files/180_1716194579.pdf', '-', 1, 0, 12, '19.3. Мәдени-көпшілік іс-шараларды ұйымдастыру көрсеткішіне әлеуметтік-мәдени бағытындағы бекітілген жоспарлар аясында атқарылған іс-шаралардың басшылықпен бекітілген хаттамасы және іс-шараны растайтын суреттер мен толық мәлімет беретін материалдардың сілтемелері жүктеледі.', 'Түркістан облысы бойынша бизнес-жобаларды іріктеуді жүзеге асыратын конкурстық комиссияға мүше болдым. Комиссия жұмысы 2023 жылдың 6-қыркүйегінде басталып,  31-жнлтоқсанға дейін созылды. Аталған уақыт аралығында 500 ден аса бизнес жобалар қаралып іріктелді.', 4, 0, 0, '20/05/2024 09:53:50', 0, NULL, 0, 0),
(3845, 105, 238, 11, 1, 5, 28, 1, NULL, NULL, '2024-01-24', '../files/238_1716194622.PDF', '-', 1, 0, 12, 'Жылда жоспарлы түрде өткізілетін қызметкерлер мен студенттердің факультет аралық дәстүрлі спартакияда ойындары 19.3. көрсеткіш бойынша бағалауға қосылмайды.', '', 4, 0, 0, '20/05/2024 14:42:52', 0, NULL, 0, 0),
