(3848, 105, 180, 11, 1, 2, 84, 1, NULL, NULL, '2023-09-26', '../files/180_1716194990.pdf', '-', 1, 0, 12, '19.3. Мәдени-көпшілік іс-шараларды ұйымдастыру көрсеткішіне әлеуметтік-мәдени бағытындағы бекітілген жоспарлар аясында атқарылған іс-шаралардың басшылықпен бекітілген хаттамасы және іс-шараны растайтын суреттер мен толық мәлімет беретін материалдардың сілтемелері жүктеледі.', 'Түркістан қаласы бойынша 2021-2025 жылдарға арналған кәсіпкерлікті қолдау Ұлттық жобасының қатысушыларына жаңа бизнес иделяарды іске асыруға арналған мемлекеттік грант беру бойынша комиссия мүшесі болдым. Бір аптаға созылған жұмыс барысында 100 ден астам бизнес идеялар талқыланып іріктелді.', 4, 0, 0, '20/05/2024 14:43:11', 0, NULL, 0, 0),
