(3995, 105, 351, 11, 1, 7, 50, 1, NULL, NULL, '2024-04-24', '../files/351_1716202570.pdf', '-', 1, 0, 12, 'Сіз жүктеген топта студенттің баяндама жасап жүргізілген тәрбие сағаты мәдени іс-шараны ұйымдастыру болып расталмайды. \r\nЕгерде шете елдік студенттерге тақырыпқа байланысты баяндамамен қоса арнайы орындардан қонақтар қосып, ұлттық ойындардың түрін ойнап көрсетіп шете елдік студенттерді қатыстырып кең көлемде шара ұйымдастырсаңыз 19.3 көрсаткіші растайды.', '', 4, 0, 0, '20/05/2024 16:54:46', 0, NULL, 0, 0),
