(4013, 105, 14, 11, 1, 13, 89, 1, NULL, NULL, '2024-05-17', '../files/14_1716203545.jpg', '-', 1, 0, 12, '19.3. Мәдени-көпшілік іс-шараларды ұйымдастыру көрсеткішіне әлеуметтік-мәдени бағытындағы бекітілген жоспарлар аясында атқарылған іс-шаралардың басшылықпен бекітілген хаттамасы және іс-шараны растайтын суреттер мен толық мәлімет беретін материалдардың сілтемелері жүктеледі.\r\nДиплом, алғыс хат, сертификаттар өзге көрсеткішке жүктеледі.', '', 4, 0, 0, '20/05/2024 17:08:27', 0, NULL, 0, 0),
