(4317, 105, 124, 11, 1, 5, 32, 1, NULL, NULL, '2024-05-20', '../files/124_1716221483.pdf', '-', 1, 0, 4, 'Мәлімет бірнеше рет жүктелген. Себебі алдыңғы резолюцияға жазылды.', '\"Қазақ тілі - ғылым тілі\" симпозиумда \"Ясауи жолы\" студент театрының қойылымының музыкамен көркемдеуші', 4, 0, 0, '20/05/2024 22:10:24', 0, NULL, 0, 0),
(4318, 8, 901, 11, 1, 8, 39, 1, NULL, NULL, '2023-11-22', '../files/901_1716221533.pdf', '-', 1, 0, 12, 'Дәлелді құжат ретінде Ахмет Ясауи университетімен жасалған екі жақты келісім-шарт салынуы қажет.', 'Ш.Шаяхметов ат. \"Тіл-Қазына\" ұлттық ғылыми-практикалық орталығының тапсырысымен \"Қазақ тілінің маңыздылығын тексеру үшін  \"Qazgramma\" көпфункционалды бағдарламалық кешенін жетілдіру жобасы аясында бекітілген жұмыс тобының КОНТЕНТ ТАЛДАУШЫ қызметін көрсеттім. Берілген модель бойынша  3000 сөйлем талданып, ықшамдылық нұсқасы жасалды.', 4, 0, 0, '20/05/2024 21:54:38', 0, NULL, 0, 0),
