(4341, 73, 105, 11, 1, 9, 37, 1, NULL, NULL, '2024-05-19', '../files/105_1716223218.pdf', '-', 1, 200, 11, 'Еңьек кітапханаға өткізілмеген', 'Авторлық куәлікте көрсетілген екі автор Жұмахан Аида және  Майлыбай Ақерке 2022-2023 оқу жылында 6В01562- химия-биология білім беру бағдарламасы бойынша  білім алған 4 курс  студенттері болған.  Жұмахан Аида және  Майлыбай Ақеркенің дипломдық жобасы бойынша  жасалған  электронды оқулыққа берілген  авторлық  куәлік', 3, 0, 0, '20/05/2024 22:33:00', 0, NULL, 0, 0),
(4342, 105, 734, 11, 1, 8, 39, 1, NULL, NULL, '2024-11-10', '../files/734_1716223253.pdf', '-', 1, 0, 12, 'Жүктелген мәліметте іс-шараны ұйымдастырушы Түркістан облысы мәдениет және туризм басқармасы, сіз баяндамшы ретінде көрініп тұр. 19.3. көрсеткіші бойынша тек баяндама жасау расталмайды.\r\n', 'ҚР Тіл саясатын дамытдың 2023-2029 жылдарға арналған тұжырымдамасын іске асыру жөніндегі іс-қимыл жоспарына сәйкес аудан, қаладағы тілдерді оқыту орталықтарының оқытушылары мен әдіскерлерінің біліктілігін арттыру, оқыту әдіснамасын жетілдіруді қолданысқа енгізу мақсатында ұйымдастырылған іс-шара.', 4, 0, 0, '20/05/2024 22:31:33', 0, NULL, 0, 0),
