DELIMITER $$
--
-- События
--
CREATE DEFINER=`erbolat`@`127.0.0.1` EVENT `update_tutor_engbek_stats` ON SCHEDULE EVERY 15 MINUTE STARTS '2024-06-03 12:20:40' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
    DELETE FROM tutor_engbek_stats;
    SELECT 
        t2.firstname,
        t2.firstnameTR,
        t2.lastname,
        t2.lastnameTR,
        t2.mail,
        COUNT(e.engbekID) AS engbek_count,
        SUM(CASE WHEN s.statusID = 2 THEN 1 ELSE 0 END) AS status_2_count,
        SUM(CASE WHEN s.statusID = 3 THEN 1 ELSE 0 END) AS status_3_count,
        SUM(CASE WHEN s.statusID = 4 THEN 1 ELSE 0 END) AS status_4_count,
        SUM(CASE WHEN s.statusID = 5 THEN 1 ELSE 0 END) AS status_5_count
    FROM engbekter e
    LEFT JOIN cafedras c ON c.cafedraID = e.kod_kafedra 
    INNER JOIN tutors t1 ON t1.TutorID = e.kod_kizm 
    INNER JOIN korsetkishter k ON k.kod_korsetkish = e.kod_korset
    INNER JOIN tutors t2 ON t2.mail = k.jauapty 
    LEFT JOIN faculties f ON f.FacultyID = e.kod_fakul 
    INNER JOIN status s ON s.statusID = e.kod_stat
    LEFT JOIN kaytaru_sebebi ks ON ks.kod_kayt_sebeb =  e.kod_kayt_sebeb 
    WHERE e.del = 0 and t1.roleID not IN(3)
    GROUP BY t2.mail, t2.firstname, t2.firstnameTR, t2.lastnameTR, t2.lastname;
END$$

CREATE DEFINER=`erbolat`@`127.0.0.1` EVENT `update_tutor_engbek_uploadstats` ON SCHEDULE EVERY 15 MINUTE STARTS '2024-06-04 15:54:23' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
    DELETE FROM tutor_engbek_uploadstats;
    SELECT 
        t1.TutorID,
        faculties.facultyNameKZ,
        faculties.facultyNameTR,
        cafedras.cafedraNameKZ,
        cafedras.cafedraNameTR,
        t1.firstname,
        t1.firstnameTR,
        t1.lastname,
        t1.lastnameTR,
        COUNT(engbekter.engbekID) AS engbek_count,
        COUNT(CASE WHEN status.statusID = 2 THEN 1 ELSE NULL END) AS status_2_count,
        COUNT(CASE WHEN status.statusID = 3 THEN 1 ELSE NULL END) AS status_3_count,
        COUNT(CASE WHEN status.statusID = 4 THEN 1 ELSE NULL END) AS status_4_count,
        COUNT(CASE WHEN status.statusID = 5 THEN 1 ELSE NULL END) AS status_5_count
    FROM tutors t1
    LEFT JOIN cafedras ON cafedras.cafedraID = t1.CafedraID
    LEFT JOIN faculties ON faculties.FacultyID = cafedras.FacultyID
    LEFT JOIN engbekter ON engbekter.kod_kizm = t1.TutorID AND engbekter.del = 0 
    LEFT JOIN korsetkishter ON korsetkishter.kod_korsetkish = engbekter.kod_korset 
    LEFT JOIN status ON status.statusID = engbekter.kod_stat
    LEFT JOIN kaytaru_sebebi ON kaytaru_sebebi.kod_kayt_sebeb = engbekter.kod_kayt_sebeb
    where t1.deleted=0 and  t1.roleID not in(2,3)
    GROUP BY
    t1.TutorID, 
    t1.firstname,
    t1.firstnameTR, 
    t1.lastname,
    t1.lastnameTR,
    faculties.facultyNameKZ, 
    faculties.facultyNameTR, 
    cafedras.cafedraNameKZ,
    cafedras.cafedraNameTR  
    ORDER BY `engbek_count` DESC;
END$$

DELIMITER ;
